	/deep/.ivu-tree-title-selected, /deep/.ivu-tree-title-selected:hover,/deep/.ivu-tree-title:hover{
		background-color: unset;
		color: #1890FF;
	}
	/deep/.ivu-table-cell-tree{
		border:0;
		font-size 15px;
		background-color unset;
	}
	/deep/.ivu-table-cell-tree .ivu-icon-ios-add:before{
		content: "\F11F";
	}
	/deep/.ivu-table-cell-tree .ivu-icon-ios-remove:before{
		content: "\F116";
	}
	.tabBox_img {
		width: 36px;
		height: 36px;
		border-radius: 4px;
		cursor: pointer;

		img {
			width: 100%;
			height: 100%;
		}
	}
	/*定义滑块 内阴影+圆角*/
	::-webkit-scrollbar-thumb{
		-webkit-box-shadow: inset 0 0 6px #ddd;
	}
	::-webkit-scrollbar {
		width: 4px!important; /*对垂直流动条有效*/
	}
.on{
	background-color #2d8cf0!important;
	color #fff!important;
}
.menu-item{
	position: relative;
	display flex
	justify-content space-between
	word-break break-all
	.icon-box{
		z-index 3
		position absolute
		right 20px
		top 50%
		transform translateY(-50%)
		display none
	}
	&:hover .icon-box{
	    display block
	}
	.right-menu{
		z-index 10
		position absolute
		right: -106px
		top: -11px
		width auto
		min-width: 121px
	}
}

.table_box{
	margin-top: 14px;
	display flex
	position relative
	.left_box{
		width: 171px;
		height: 470px
		border-right: 1px solid #EEEEEE;
		overflow-x hidden;
		overflow-y auto;
		.left_cont{
			margin-bottom 12px
			cursor pointer
		}
	}
	.right_box{
		margin-left 23px
		font-size: 13px;
		font-family: PingFang SC;
		width 645px;
		height: 470px;
		overflow-x hidden;
		overflow-y auto;
		.cont{
			font-weight: 500;
			color: #000000
			font-weight bold
		}
		.Box{
			margin-top 19px
			display flex
			flex-wrap wrap
			.cont_box{
				font-weight: 400;
				color: rgba(0, 0, 0, 0.85);
				background: #FAFAFA;
				border-radius: 3px;
				text-align center
				padding 7px 30px
				margin-right 10px
				margin-bottom 18px
				cursor pointer
				&:hover{
					background-color #eee
					color #333;
				}
			}
			.item{
				position relative;
				.iconfont{
					display none;
				}
				&:hover{
					.iconfont{
						display block;
					}
				}
			}
			.iconfont{
				position absolute
				right 9px;
				top:-8px;
				font-size 18px;
				color #333;
			}
		}

	}
	.Button{
		position absolute
		bottom 15px
		right 15px
		font-family: PingFangSC-Regular;
		text-align center
		.cancel{
			width: 70px;
			height: 32px;
			background: #FFFFFF;
			border: 1px solid rgba(0, 0, 0, 0.14901960784313725);
			border-radius: 2px;
			font-size: 14px;
			color: #000000
			line-height 32px
			float left
			margin-right 10px
			cursor pointer
		}
		.ok{
			width: 70px;
			height: 32px;
			background: #1890FF;
			border-radius: 2px;
			font-size: 14px;
			color: #FFFFFF;
			line-height 32px
			float left
			cursor pointer
		}
	}
}
